var newmsg = {};
//  Measured output from the rotator at BARC
//
//  Millivolts
//  180	        North
//  723	        East
//  1254	    South
//  1776	    West
//  2295	    North
//  2130        OverLap

// 522 x 4 = 2088
// 360/2088 = 0.172
//
var millivolts = msg.payload["/dev/i2c-1"].ads1015["0x48"].singleEnded.channel_0.miliVolts

newmsg.payload = (millivolts-180)*0.17;
newmsg.realdegrees = newmsg.payload

if (newmsg.payload > 359) {
    newmsg.payload = newmsg.payload - 360;
}

if (newmsg.payload < 1) {
    newmsg.payload = newmsg.payload + 360;
}

newmsg.payload = Number(newmsg.payload).toFixed(0);
newmsg.realdegrees = Number(newmsg.realdegrees).toFixed(0);
return newmsg;

